import React from "react";
import SearchPlace from "./map/SearchPlace";
import SearchHealingPlace from "./map/SearchHealingPlace";
import {
  Container,
  Box,
  Button,
  Grid,
  RadioGroup,
  FormControlLabel,
  FormControl,
  Radio,
} from "@material-ui/core";
export default function Recommend() {
  return (
    <div>
      <Grid container justify="center">
        <Grid container justify="center">
          <h1>추천 서비스</h1>
        </Grid>
        <Grid container justify="center">
          <h2>내 주변 상담시설</h2>
        </Grid>

        <SearchPlace />
        <Grid>
          <h2>내 주변 힐링 플레이스</h2>
        </Grid>

        <SearchHealingPlace />
      </Grid>
    </div>
  );
}
